review.body:
I like what you have done, but I think we can slightly improve upon the implementation. With the code in this PR, this works (assuming each path has an `index.html`):

`http://somewhere.com/`

but this doesn't:

`http://somewhere.com/nested/`

As a suggestion, instead of modifying `IgnoreIndex()`, perhaps add the following:

```go
// PreventListings returns a function that prevents listing of directories but
// still allows index.html to be served.
func PreventListings(serve http.HandlerFunc) http.HandlerFunc {
	return func(w http.ResponseWriter, r *http.Request) {
		if strings.HasSuffix(r.URL.Path, "/") {
			// If the directory does not contain an index.html file, then
			// return 'NOT FOUND' to prevent listing of the directory.
			stat, err := os.Stat(path.Join(r.URL.Path, "index.html"))
			if err != nil || !stat.Mode().IsRegular() {
				http.NotFound(w, r)
				return
			}
		}
		serve(w, r)
	}
}
```

With that, the handler logic might look something like:

```go
// Determine whether index files should hidden.
if !config.Get.ShowListing {
    if config.Get.AllowIndex {
        handler = handle.PreventListings(handler)
    } else {
        handler = handle.IgnoreIndex(handler)
    }
}
```

Where, to preserve previous behavior:

```bash
# Automatically serve the index file for a given directory (default). If set to
# 'false', URLs ending with a '/' will return 'NOT FOUND' unless ALLOW_INDEX is
# set to true, in which case directory listings are suppressed but index.html
# files are served, if present.
SHOW_LISTING=true

# Allow index file to be served even if SHOW_LISTING is set to false. This
# variable is only evaluated when SHOW_LISTING is false.
ALLOW_INDEX=false
```

Does that seem reasonable?

